// Home.jsx
import React from 'react';
import {
  Container,
  Typography,
  Box,
  Button,
  Grid,
  useTheme,
  IconButton,
  Card,
  CardContent
} from '@mui/material';
import { useNavigate } from 'react-router-dom';
import AccessTimeIcon from '@mui/icons-material/AccessTime';
import AutoGraphIcon from '@mui/icons-material/AutoGraph';
import CalendarMonthIcon from '@mui/icons-material/CalendarMonth';
import KeyboardArrowDownIcon from '@mui/icons-material/KeyboardArrowDown';
import SecurityIcon from '@mui/icons-material/Security';
import SpeedIcon from '@mui/icons-material/Speed';
import GroupsIcon from '@mui/icons-material/Groups';

// Custom theme colors
const themeColors = {
  boxBlue: '#0061D5',
  boxLightBlue: '#F2F7FD',
  boxGray: '#222222',
  boxLightGray: '#F7F7F7',
  boxBorderGray: '#E8E8E8'
};

// Feature data
const features = [
  {
    icon: <AccessTimeIcon sx={{ fontSize: 48, color: themeColors.boxBlue }} />,
    title: "AI-Powered Scheduling",
    description: "Intelligent algorithms that adapt to your learning patterns and optimize your study time."
  },
  {
    icon: <AutoGraphIcon sx={{ fontSize: 48, color: themeColors.boxBlue }} />,
    title: "Performance Analytics",
    description: "Track your progress with detailed insights and personalized recommendations."
  },
  {
    icon: <CalendarMonthIcon sx={{ fontSize: 48, color: themeColors.boxBlue }} />,
    title: "Smart Calendar",
    description: "Seamlessly integrate your study schedule with your daily routine."
  }
];

// Benefits data
const benefits = [
  {
    icon: <SpeedIcon sx={{ fontSize: 40, color: themeColors.boxBlue }} />,
    title: "Increased Efficiency",
    description: "Optimize your study time with AI-driven recommendations."
  },
  {
    icon: <SecurityIcon sx={{ fontSize: 40, color: themeColors.boxBlue }} />,
    title: "Reliable Progress",
    description: "Track and maintain consistent progress towards your goals."
  },
  {
    icon: <GroupsIcon sx={{ fontSize: 40, color: themeColors.boxBlue }} />,
    title: "Collaborative Learning",
    description: "Connect with peers and share study resources effectively."
  }
];

function Home() {
  const theme = useTheme();
  const navigate = useNavigate();

  const scrollToFeatures = () => {
    const featuresSection = document.getElementById('features');
    featuresSection.scrollIntoView({ behavior: 'smooth' });
  };

  return (
    <Box sx={{ minHeight: '100vh' }}>
      {/* Hero Section */}
      <Box
        sx={{
          minHeight: '90vh',
          display: 'flex',
          alignItems: 'center',
          bgcolor: themeColors.boxLightBlue,
          position: 'relative',
          overflow: 'hidden',
          '&::after': {
            content: '""',
            position: 'absolute',
            top: 0,
            right: '-10%',
            width: '60%',
            height: '100%',
            backgroundColor: themeColors.boxBlue,
            opacity: 0.03,
            transform: 'skewX(-15deg)',
            display: { xs: 'none', md: 'block' }
          }
        }}
      >
        <Container maxWidth="lg">
          <Grid container spacing={4} alignItems="center">
            <Grid item xs={12} md={6}>
              <Box sx={{
                py: { xs: 4, md: 8 },
                pr: { md: 8 }
              }}>
                <Typography
                  variant="h1"
                  sx={{
                    fontSize: { xs: '2.5rem', md: '3.75rem' },
                    fontWeight: 800,
                    color: themeColors.boxGray,
                    lineHeight: 1.2,
                    mb: 3
                  }}
                >
                  Study Smarter,<br />
                  Not Harder
                </Typography>
                <Typography
                  variant="h2"
                  sx={{
                    fontSize: { xs: '1.25rem', md: '1.5rem' },
                    color: 'text.secondary',
                    mb: 4,
                    fontWeight: 400,
                    lineHeight: 1.6
                  }}
                >
                  Let AI optimize your study schedule and maximize your learning potential.
                </Typography>
                <Box sx={{ display: 'flex', gap: 2 }}>
                  <Button
                    variant="contained"
                    size="large"
                    onClick={() => navigate('/register')}
                    sx={{
                      bgcolor: themeColors.boxBlue,
                      py: 2,
                      px: 4,
                      fontSize: '1rem',
                      fontWeight: 600,
                      '&:hover': {
                        bgcolor: '#004fb3'
                      }
                    }}
                  >
                    Start Free Trial
                  </Button>
                  <Button
                    variant="outlined"
                    size="large"
                    onClick={() => navigate('/learn-more')}
                    sx={{
                      color: themeColors.boxBlue,
                      borderColor: themeColors.boxBlue,
                      py: 2,
                      px: 4,
                      fontSize: '1rem',
                      fontWeight: 600,
                      '&:hover': {
                        borderColor: '#004fb3',
                        bgcolor: 'transparent'
                      }
                    }}
                  >
                    Learn More
                  </Button>
                </Box>
              </Box>
            </Grid>
          </Grid>
        </Container>
        <Box
          sx={{
            position: 'absolute',
            bottom: 40,
            left: '50%',
            transform: 'translateX(-50%)',
            textAlign: 'center',
            cursor: 'pointer',
          }}
          onClick={scrollToFeatures}
        >
          <IconButton
            sx={{
              color: themeColors.boxBlue,
              animation: 'bounce 2s infinite',
              '@keyframes bounce': {
                '0%, 20%, 50%, 80%, 100%': {
                  transform: 'translateY(0)',
                },
                '40%': {
                  transform: 'translateY(-10px)',
                },
                '60%': {
                  transform: 'translateY(-5px)',
                },
              },
            }}
          >
            <KeyboardArrowDownIcon />
          </IconButton>
        </Box>
      </Box>

      {/* Features Section */}
      <Box id="features" sx={{ py: 12, bgcolor: '#ffffff' }}>
        <Container maxWidth="lg">
          <Typography
            variant="h3"
            align="center"
            sx={{
              fontSize: { xs: '2rem', md: '2.5rem' },
              fontWeight: 700,
              color: themeColors.boxGray,
              mb: 2
            }}
          >
            Features that make studying smarter
          </Typography>
          <Typography
            variant="body1"
